import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Contacts from './Contacts.js'

class App extends Component {
  render() {
    return (
      <div className="App">
        <header>
          IronContacts
        </header>
        <p>
          <Contacts />
        </p>
      </div>
    );
  }
}

export default App;
